package com.fichapp.model;public class OrigemModel {	private Long id;	private String uuid;	private String nome;	private String descricao;	public OrigemModel() {	}	public OrigemModel(Long id) {		super();		this.id = id;	}	public Long getId() {		return id;	}	public void setId(Long id) {		this.id = id;	}	public String getUuid() {		return uuid;	}	public void setUuid(String uuid) {		this.uuid = uuid;	}	public String getNome() {		return nome;	}	public void setNome(String nome) {		this.nome = nome;	}	public String getDescricao() {		return descricao;	}	public void setDescricao(String descricao) {		this.descricao = descricao;	}}